/**
 * @author Aming
 * @name 登录
 * @origin 红灯区
 * @version 1.1.1
 * @description Ark对接工具
 * @rule pt_key=[\S]{15,};[ ]*pt_pin=[\S]{2,};
 * @rule pin=[\S]{2,};[ ]*wskey=[\S]{15,};
 * @rule ^(登录|登陆|上车|账号管理|账户管理)$
 * @priority 1000
 * @admin false
 * @public false
 * @disable false


 说明：
    扫码登录(nolanPro)
        // Pro 的扫码地址
        set jd_cookie NolanProUrl http://192.168.31.192:5709
        // Pro的对接token
        set jd_cookie NolanProToken 12456
        // 无界的host 要保证对接的平台(例如wx千寻)能访问到该地址
        set system Host http://192.168.31.192:9090
        必要参数替换你自己的
    口令登录(依赖nolanPro扫码登录,用之前先把扫码登录配置好)
    
    扫码登录(rabbit)
        // rabbit 的扫码地址
        set jd_cookie rabbit_qrcodeURL http://192.168.31.192:5709
        // rabbit的对接token
        set jd_cookie rabbit_qrcodeTOKEN CB2B8126557C5589F8CA94BD13587E86
        // 无界的host 要保证对接工具能访问到该地址
        set system Host http://192.168.31.192:9090
        必要参数替换你自己的
    短信登录功能：
        支持对接Ark协议的登录工具（仅测试了ark，其他自测）
        set jd_cookie nolan_addr xxxx
        支持直接发pt_key=xx;pt_pin=xx; 上车
        支持直接发pin=xx;wskey=xxxxxx; 上车
        面板管理里设置上车面板
    
    备注功能：
        只有新用户会触发录入备注信息，已经存在于上车面板中的ck只会更新ck
        备注进青龙的格式为：备注@@时间戳@@UID
        支持上车后修改备注，发送【修改备注】 会自动读取当前账号绑定的pin进行修改
        修改备注会应用于全部面板中的JD_COOKIE
 

 自定义：
  * 【白名单群号，多个群需开启用英文&分割】
     默认：12345678910&12345678911
     修改：set jd_cookie whiteList xxxxxxxxxx

 * 【输入手机号提示】
     默认：Mobile phone number?
     修改：set jd_cookie phoneInputTip xxxxxxxxxx

 * 【手机号输入错误提示】
     默认：错误！重新输入：
     修改：set jd_cookie phoneInputErrTip xxxxxxxxxx

 * 【输入验证码提示】
     默认：code：
     修改：set jd_cookie codeTip xxxxxxxxxx

 * 【验证输入错误提示】
     默认：错误！重新输入：
     修改：set jd_cookie codeInputErrTip xxxxxxxxxx
     
 * 【超时提示
     默认：超时 已退出】
     修改：set jd_cookie overTimeTip xxxxxxxxxx
     
 * 【q退出提示】
     默认：已退出
     修改：set jd_cookie quitTip xxxxxxxxxx
     
 * 【新用户登录成功 需要发送给用户的提示】
     默认：空
     示例：已成功登录！\n1.请务必加入QQ群：xxxxx
     修改：set jd_cookie newLoginOkLogsTip xxxxxxxxxx
     
 * 【老用户更新成功 需要发送给用户的信息】
     默认：空
     修改：set jd_cookie oldLoginOkLogsTip xxxxxxxxxx
     
 * 【非白名单群触发登录提示】
     默认：不要捣蛋
     修改：set jd_cookie noWhiteListLogsTip xxxxxxxxxx

 * 【新用户登录成功后，是否触发录入 备注 流程，0关闭，1开启】
     默认：1
     修改：set jd_cookie remarksOpen xxxxxxxxxx
     
 * 【新用户登录成功后，是否触发录入wxPusher UID 流程，0关闭，1开启】
     默认：0
     修改：set jd_cookie wxPusherOpen xxxxxxxxxx
     
 * 【录入Wxpusher指引】
     默认：空
     示例：OK，需要接收【收益推送】的请点击链接关注WxPusher公众号，否则回复t跳过本程序\n
     https://wxpusher.zjiecode.com/wxuser/?type=1&id=xxxxxxxxxx#/follow \n \n
     关注后 依次点击右下角【我的】→【我的UID】→复制UID粘贴给我：
     修改：set jd_cookie wxPusherLogsTip xxxxxxxxxx
 * 【录入wxPusher时 t跳过后提示】
     默认：未回复UID，你将不会收到资产变动推送
     修改：set jd_cookie wxPusherErrTip xxxxxxxxxx
 * 【超时等待时间】
     默认：60
     修改：set jd_cookie arkWaitTime xxxxxxxxxx
 * 【身份证二验提示】
     默认：请输入你的身份证前2位与后4位：
     修改：set jd_cookie userIdTip xxxxxxxxxx
 * 【身份证输入错误提示】
     默认：错误，请输入正确的身份证前2后4
     修改：set jd_cookie userIdErr xxxxxxxxxx
 * 【新设备登录确认提示】
     默认：新设备登录需要验证，前往京东APP-我的-设置-账户与安全-新设备登录确认中确认，好了对我说:‘已确认’，取消发q
     修改：set jd_cookie deviceTip xxxxxxxxxx
 * 【未对接ark提示】
     默认：未对接Ark
     修改：set jd_cookie noNolanAddrTip xxxxxxxxxx
 * 【JD_COOKIE上车面板】
 *   默认：面板管理中的上车面板
 *   修改：set jd_cookie JD_COOKIE_UP_Default 1
 * 【WSCK上车面板】
 *   默认：面板管理中的上车面板
 *   修改：set jd_cookie JD_WSCK_UP_Default 4


*/

